BEGIN TRANSACTION;
DROP TABLE IF EXISTS "synet_waterconsumption";
CREATE TABLE IF NOT EXISTS "synet_waterconsumption" (
	"id"	integer NOT NULL,
	"serialNumber"	integer,
	"customer"	varchar(100) NOT NULL,
	"date"	date NOT NULL,
	"collecter"	varchar(20),
	"counter"	varchar(20),
	"finalIndication"	integer NOT NULL,
	"initialIndication"	integer NOT NULL,
	"intermediateIndication"	integer,
	"cubicMeters"	integer,
	"billableCubicMeters"	integer,
	"hydronomistsCubicMeters"	decimal,
	"cost"	decimal,
	"hydronomistsRight"	decimal,
	"paid"	decimal,
	"paymentDate"	date,
	"receivedBy"	varchar(10),
	"receiptNumber"	integer,
	"balance"	decimal,
	"viberMsg"	varchar(200),
	"notes"	text,
	"fields"	varchar(20),
	"olivesNumber"	integer,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "synet_paids";
CREATE TABLE IF NOT EXISTS "synet_paids" (
	"id"	integer NOT NULL,
	"paid"	decimal,
	"paymentDate"	date,
	"receiptNumber"	integer,
	"balance"	decimal,
	"irrigation_id"	bigint,
	"receiver_id"	bigint,
	FOREIGN KEY("receiver_id") REFERENCES "synet_receivers"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("irrigation_id") REFERENCES "synet_watercons"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "synet_receivers";
CREATE TABLE IF NOT EXISTS "synet_receivers" (
	"id"	integer NOT NULL,
	"receiver"	varchar(30) NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "synet_counters";
CREATE TABLE IF NOT EXISTS "synet_counters" (
	"id"	integer NOT NULL,
	"collecter"	varchar(20) NOT NULL,
	"counter"	varchar(20),
	"customer_id"	bigint,
	FOREIGN KEY("customer_id") REFERENCES "synet_persons"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "synet_fields";
CREATE TABLE IF NOT EXISTS "synet_fields" (
	"id"	integer NOT NULL,
	"field"	varchar(20),
	"olivesNumber"	integer,
	"customer_id"	bigint NOT NULL,
	FOREIGN KEY("customer_id") REFERENCES "synet_persons"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "synet_watercons";
CREATE TABLE IF NOT EXISTS "synet_watercons" (
	"id"	integer NOT NULL,
	"serialNumber"	integer,
	"date"	date NOT NULL,
	"finalIndication"	integer NOT NULL,
	"initialIndication"	integer NOT NULL,
	"intermediateIndication"	integer,
	"cubicMeters"	integer,
	"billableCubicMeters"	integer,
	"hydronomistsCubicMeters"	decimal,
	"cost"	decimal,
	"hydronomistsRight"	decimal,
	"viberMsg"	varchar(200),
	"notes"	text,
	"counter_id"	bigint NOT NULL,
	"customer_id"	bigint NOT NULL,
	"field_id"	bigint,
	"costPerMeter"	decimal,
	FOREIGN KEY("customer_id") REFERENCES "synet_persons"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("field_id") REFERENCES "synet_fields"("id") DEFERRABLE INITIALLY DEFERRED,
	FOREIGN KEY("counter_id") REFERENCES "synet_counters"("id") DEFERRABLE INITIALLY DEFERRED,
	PRIMARY KEY("id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "synet_persons";
CREATE TABLE IF NOT EXISTS "synet_persons" (
	"id"	integer NOT NULL,
	"fathersName"	varchar(100),
	"name"	varchar(100),
	"surname"	varchar(100) NOT NULL,
	"member"	bool NOT NULL,
	"payAsMember"	bool NOT NULL,
	"isActive"	bool NOT NULL,
	"aa"	integer UNIQUE,
	"afm"	varchar(9) UNIQUE,
	"placeΟfΡesidence"	varchar(20),
	"mobilePhone"	varchar(10),
	"notes"	varchar(100),
	PRIMARY KEY("id" AUTOINCREMENT)
);
